const navLinks = document.querySelectorAll(".nav-link");
      const sections = {
        home: document.getElementById("home"),
        contact: document.getElementById("contact"),
        information: document.getElementById("information"),
        ulasan: document.getElementById("ulasan"),
      };

      navLinks.forEach((link) => {
        link.addEventListener("click", () => {
          // Remove active class from all links
          navLinks.forEach((l) => l.classList.remove("active"));
          // Hide all sections
          Object.values(sections).forEach((sec) => {
            sec.hidden = true;
            sec.classList.remove("active-section");
          });
          // Show selected section
          const target = link.getAttribute("data-target");
          sections[target].hidden = false;
          sections[target].classList.add("active-section");
          link.classList.add("active");

          // For accessibility focus
          sections[target].focus();
        });
      });

      // Coffee product data
      const products = [
        {
          id: "matcha",
          name: "Matcha Latte",
          price: 25000,
          img: "data:image/jpeg;base64,",
          desc: "Fresh Matcha green tea latte for a smooth, refreshing taste.",
        },
        {
          id: "espresso",
          name: "Espresso",
          price: 20000,
          img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTBRjIwdwJHyJa9Kwh7Q4xzwC_nG7eg8lhvajx1pCQegT_wA7ubmp0TUEXcHW9mbm3XmpQ&usqp=CAU",
          desc: "Strong and bold espresso shot, the essence of coffee.",
        },
        {
          id: "americano",
          name: "Americano",
          price: 22000,
          img: "data:image/jpeg;base64,",
          desc: "Classic Americano, smooth and simple brewed perfection.",
        },
        {
          id: "latte",
          name: "Caffe Latte",
          price: 28000,
          img: "data:image/jpeg;base64,",
          desc: "Creamy caffe latte topped with luscious foam.",
        },
        {
          id: "cappuccino",
          name: "Cappuccino",
          price: 27000,
          img: "data:image/jpeg;base64,",
          desc: "A perfect balance of espresso, steamed milk and foam.",
        },
        {
          id: "mocha",
          name: "Mocha",
          price: 30000,
          img: "data:image/jpeg;base64,",
          desc: "Chocolate flavored coffee treat to delight your senses.",
        },
        {
          id: "black coffe",
          name: "black coffe",
          price: 20000,
          img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTuSBoh56D25FkO0leExudGB36F30wU89IMbA&s",
          desc: "A classic brew made purely from ground coffee beans without any additives",
        },
        {
          id: "milk coffe",
          name: "Milk coffe",
          price: 22000,
          img: "data:image/jpeg;base64,",
          desc: "A smooth blend of coffee and milk, offering a creamy, slightly sweet taste while maintaining the essence of coffee",
        },
      ];

      const productsContainer = document.querySelector(".products");
      let cart = [];

      function formatPrice(num) {
        return "Rp " + num.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ".");
      }

      // Render product cards
      function renderProducts() {
        productsContainer.innerHTML = "";
        products.forEach((prod) => {
          const prodEl = document.createElement("div");
          prodEl.className = "product";
          prodEl.innerHTML = `
        <img src="${prod.img}" alt="${prod.name}" />
        <h3>${prod.name}</h3>
        <p class="desc">${prod.desc}</p>
        <span class="price">${formatPrice(prod.price)}</span>
        <button aria-label="Add ${prod.name} to cart">Add to Cart</button>
      `;
          const btn = prodEl.querySelector("button");
          btn.addEventListener("click", () => addToCart(prod.id));
          productsContainer.appendChild(prodEl);
        });
      }

      // Add to cart
      function addToCart(prodId) {
        const prod = products.find((p) => p.id === prodId);
        if (!prod) return;
        const existingItem = cart.find((item) => item.id === prodId);
        if (existingItem) {
          existingItem.qty++;
        } else {
          cart.push({ ...prod, qty: 1 });
        }
        updateCartCount();
        alert(`${prod.name} added to cart!`);
      }

      // Update cart count in header
      function updateCartCount() {
        const count = cart.reduce((acc, item) => acc + item.qty, 0);
        document.getElementById("cartCount").textContent = count;
      }

      // Cart modal controls and render
      const cartModal = document.getElementById("cartModal");
      let currentModalHtml = cartModal.innerHTML;
      const openCartBtn = document.getElementById("openCartBtn");
      let closeCartBtn = cartModal.querySelector(".close-btn");
      const cartItemsUl = document.getElementById("cartItems");
      const cartTotalDiv = document.getElementById("cartTotal");
      let checkoutBtn = document.getElementById("checkoutBtn");

      openCartBtn.addEventListener("click", () => {
        renderCartItems();
        cartModal.style.display = "block";
        cartModal.setAttribute("aria-hidden", "false");
        // refresh closeBtn and checkoutBtn references due to possible modal re-render
        closeCartBtn = cartModal.querySelector(".close-btn");
        checkoutBtn = document.getElementById("checkoutBtn");
        attachModalListeners();
      });

      // Close cart modal function
      function closeCartModal() {
        cartModal.style.display = "none";
        cartModal.setAttribute("aria-hidden", "true");
      }

      // Close cart on close button
      function attachModalListeners() {
        closeCartBtn = cartModal.querySelector(".close-btn");
        checkoutBtn = document.getElementById("checkoutBtn");
        if (closeCartBtn) {
          closeCartBtn.addEventListener("click", closeCartModal);
        }
        if (checkoutBtn) {
          checkoutBtn.addEventListener("click", handleCheckout);
        }
      }

      // Close cart if clicked outside modal content
      window.addEventListener("click", (e) => {
        if (e.target === cartModal) {
          closeCartModal();
        }
      });

      // Render cart items in modal
      function renderCartItems() {
        cartItemsUl.innerHTML = "";
        if (cart.length === 0) {
          cartItemsUl.innerHTML = `<li>Your cart is empty.</li>`;
          cartTotalDiv.textContent = "Total: Rp 0";
          if (checkoutBtn) checkoutBtn.disabled = true;
          return;
        }
        if (checkoutBtn) checkoutBtn.disabled = false;
        cart.forEach((item) => {
          const li = document.createElement("li");
          li.innerHTML = `
        <span>${item.name}</span>
        <span><span class="qty">x${item.qty}</span> - ${formatPrice(
            item.price * item.qty
          )}</span>
        <button aria-label="Remove one ${item.name} from cart" data-id="${
            item.id
          }">✕</button>
      `;
          const removeBtn = li.querySelector("button");
          removeBtn.style.background = "none";
          removeBtn.style.border = "none";
          removeBtn.style.color = "#e7ac21";
          removeBtn.style.cursor = "pointer";
          removeBtn.style.fontSize = "1.1rem";
          removeBtn.addEventListener("click", () => removeFromCart(item.id));
          cartItemsUl.appendChild(li);
        });
        const totalPrice = cart.reduce(
          (acc, item) => acc + item.price * item.qty,
          0
        );
        cartTotalDiv.textContent = `Total: ${formatPrice(totalPrice)}`;
      }

      // Remove one qty from cart for given id
      function removeFromCart(prodId) {
        const idx = cart.findIndex((item) => item.id === prodId);
        if (idx === -1) return;
        if (cart[idx].qty > 1) {
          cart[idx].qty--;
        } else {
          cart.splice(idx, 1);
        }
        updateCartCount();
        renderCartItems();
      }

      // Checkout handler
      function handleCheckout() {
        if (cart.length === 0) return;
        cartModal.innerHTML = `
      <div class="modal-content" role="document" tabindex="0">
        <h3>Thank You!</h3>
        <p>Your order has been received and is being prepared. We'll notify you shortly. Enjoy your coffee ☕️</p>
        <button id="leaveReviewBtn" style="margin-top:20px; padding:10px 25px; background:#e7ac21; border:none; border-radius:30px; font-weight:700; cursor:pointer;">Leave a Review</button>
        <button id="closeThankYouBtn" style="margin-top:10px; padding:10px 25px; background:#4b2e0e; border: 2px solid #e7ac21; border-radius:30px; color:#e7ac21; font-weight:700; cursor:pointer;">Close</button>
      </div>
    `;
        const leaveReviewBtn = document.getElementById("leaveReviewBtn");
        const closeThankYouBtn = document.getElementById("closeThankYouBtn");
        leaveReviewBtn.focus();

        leaveReviewBtn.addEventListener("click", () => {
          closeCartModal();
          // Reset cart and counts
          cart = [];
          updateCartCount();
          // Restore modal original content for next time
          cartModal.innerHTML = currentModalHtml;
          attachModalListeners();
          navigateToUlasan();
        });

        closeThankYouBtn.addEventListener("click", () => {
          closeCartModal();
          // Reset cart and counts
          cart = [];
          updateCartCount();
          // Restore modal original content for next time
          cartModal.innerHTML = currentModalHtml;
          attachModalListeners();
        });
      }

      // Navigate to Ulasan tab, programmatically activate nav and section
      function navigateToUlasan() {
        // Deactivate all nav links and sections first
        navLinks.forEach((l) => l.classList.remove("active"));
        Object.values(sections).forEach((sec) => {
          sec.hidden = true;
          sec.classList.remove("active-section");
        });

        // Activate ulasan nav and section
        const ulasanNav = Array.from(navLinks).find(
          (l) => l.getAttribute("data-target") === "ulasan"
        );
        ulasanNav.classList.add("active");
        sections.ulasan.hidden = false;
        sections.ulasan.classList.add("active-section");
        sections.ulasan.focus();
      }

      // Review functionality
      const reviewForm = document.getElementById("reviewForm");
      const reviewListDiv = document.querySelector("#ulasan .review-list");

      // Read reviews from localStorage or initialize
      let reviews = JSON.parse(localStorage.getItem("customerReviews")) || [];

      // Render reviews list
      function renderReviews() {
        reviewListDiv.innerHTML = "";
        if (reviews.length === 0) {
          reviewListDiv.innerHTML =
            "<p>No reviews yet. Be the first to leave a review!</p>";
          return;
        }
        reviews.forEach(({ name, rating, comment }) => {
          const reviewEl = document.createElement("div");
          reviewEl.className = "review";
          reviewEl.innerHTML = `
        <strong>${escapeHtml(name)}</strong>
        <div class="rating">${"★".repeat(rating)}${"☆".repeat(5 - rating)}</div>
        <p class="comment">${escapeHtml(comment)}</p>
      `;
          reviewListDiv.appendChild(reviewEl);
        });
      }

      // Escape HTML to prevent injection
      function escapeHtml(text) {
        const div = document.createElement("div");
        div.innerText = text;
        return div.innerHTML;
      }

      // Handle review form submission
      reviewForm.addEventListener("submit", (e) => {
        e.preventDefault();
        const name = reviewForm.reviewName.value.trim();
        const rating = parseInt(reviewForm.reviewRating.value);
        const comment = reviewForm.reviewComment.value.trim();
        if (!name || !rating || !comment) {
          alert("Please fill all fields and select a rating.");
          return;
        }
        reviews.push({ name, rating, comment });
        localStorage.setItem("customerReviews", JSON.stringify(reviews));
        reviewForm.reset();
        renderReviews();
        alert("Thank you for your review!");
      });

      // Initialize site
      renderProducts();
      updateCartCount();
      attachModalListeners();
      renderReviews();